import React from "react";

function Analytics({ tasks, currentTheme }) {
  const isDarkMode = currentTheme === "Dark Mode";

  const getTaskCompletionRate = () => {
    if (tasks.length === 0) return 0;
    const completedTasks = tasks.filter((task) => task.completed).length;
    return Math.round((completedTasks / tasks.length) * 100);
  };

  const completedTasksCount = tasks.filter((task) => task.completed).length;

  return (
    <div
      className={`rounded-lg shadow ${isDarkMode ? "bg-gray-700" : "bg-white"}`}
    >
      <div
        className={`p-4 border-b ${
          isDarkMode ? "border-gray-600" : "border-gray-200"
        }`}
      >
        <h2
          className={`font-semibold ${
            isDarkMode ? "text-gray-200" : "text-gray-800"
          }`}
        >
          Study Analytics
        </h2>
      </div>
      <div className="p-8 text-center">
        <div
          className={`inline-block p-12 rounded-full mb-4 ${
            isDarkMode ? "bg-gray-600" : "bg-gray-100"
          }`}
        >
          <div
            className={`text-4xl font-bold ${
              isDarkMode ? "text-indigo-400" : "text-indigo-600"
            }`}
          >
            {getTaskCompletionRate()}%
          </div>
        </div>
        <h3
          className={`text-lg font-medium ${
            isDarkMode ? "text-gray-200" : "text-gray-800"
          }`}
        >
          Task Completion Rate
        </h3>
        <p className={`mt-2 ${isDarkMode ? "text-gray-400" : "text-gray-500"}`}>
          You've completed {completedTasksCount} out of {tasks.length} tasks
        </p>

        <div className="mt-8 grid grid-cols-1 md:grid-cols-2 gap-4">
          <div
            className={`p-4 rounded-lg ${
              isDarkMode ? "bg-gray-600" : "bg-gray-50"
            }`}
          >
            <h4
              className={`font-medium mb-2 ${
                isDarkMode ? "text-gray-200" : "text-gray-800"
              }`}
            >
              Subject Distribution
            </h4>
            <div className="flex justify-center space-x-2 mt-4">
              <div className="flex flex-col items-center">
                <div
                  className={`w-4 h-20 rounded-t-sm ${
                    isDarkMode ? "bg-indigo-500" : "bg-indigo-600"
                  }`}
                ></div>
                <span
                  className={`text-xs mt-1 ${
                    isDarkMode ? "text-gray-400" : "text-gray-800"
                  }`}
                >
                  Math
                </span>
              </div>
              <div className="flex flex-col items-center">
                <div
                  className={`w-4 h-12 rounded-t-sm ${
                    isDarkMode ? "bg-indigo-400" : "bg-indigo-400"
                  }`}
                ></div>
                <span
                  className={`text-xs mt-1 ${
                    isDarkMode ? "text-gray-400" : "text-gray-800"
                  }`}
                >
                  Sci
                </span>
              </div>
              <div className="flex flex-col items-center">
                <div
                  className={`w-4 h-16 rounded-t-sm ${
                    isDarkMode ? "bg-indigo-400" : "bg-indigo-500"
                  }`}
                ></div>
                <span
                  className={`text-xs mt-1 ${
                    isDarkMode ? "text-gray-400" : "text-gray-800"
                  }`}
                >
                  Eng
                </span>
              </div>
              <div className="flex flex-col items-center">
                <div
                  className={`w-4 h-8 rounded-t-sm ${
                    isDarkMode ? "bg-indigo-300" : "bg-indigo-300"
                  }`}
                ></div>
                <span
                  className={`text-xs mt-1 ${
                    isDarkMode ? "text-gray-400" : "text-gray-800"
                  }`}
                >
                  Hist
                </span>
              </div>
            </div>
          </div>

          <div
            className={`p-4 rounded-lg ${
              isDarkMode ? "bg-gray-600" : "bg-gray-50"
            }`}
          >
            <h4
              className={`font-medium mb-2 ${
                isDarkMode ? "text-gray-200" : "text-gray-800"
              }`}
            >
              Study Time by Day
            </h4>
            <div className="flex justify-center space-x-2 mt-4">
              <div className="flex flex-col items-center">
                <div
                  className={`w-4 h-8 rounded-t-sm ${
                    isDarkMode ? "bg-indigo-300" : "bg-indigo-300"
                  }`}
                ></div>
                <span
                  className={`text-xs mt-1 ${
                    isDarkMode ? "text-gray-400" : "text-gray-800"
                  }`}
                >
                  M
                </span>
              </div>
              <div className="flex flex-col items-center">
                <div
                  className={`w-4 h-12 rounded-t-sm ${
                    isDarkMode ? "bg-indigo-400" : "bg-indigo-400"
                  }`}
                ></div>
                <span
                  className={`text-xs mt-1 ${
                    isDarkMode ? "text-gray-400" : "text-gray-800"
                  }`}
                >
                  T
                </span>
              </div>
              <div className="flex flex-col items-center">
                <div
                  className={`w-4 h-16 rounded-t-sm ${
                    isDarkMode ? "bg-indigo-400" : "bg-indigo-500"
                  }`}
                ></div>
                <span
                  className={`text-xs mt-1 ${
                    isDarkMode ? "text-gray-400" : "text-gray-800"
                  }`}
                >
                  W
                </span>
              </div>
              <div className="flex flex-col items-center">
                <div
                  className={`w-4 h-20 rounded-t-sm ${
                    isDarkMode ? "bg-indigo-500" : "bg-indigo-600"
                  }`}
                ></div>
                <span
                  className={`text-xs mt-1 ${
                    isDarkMode ? "text-gray-400" : "text-gray-800"
                  }`}
                >
                  T
                </span>
              </div>
              <div className="flex flex-col items-center">
                <div
                  className={`w-4 h-10 rounded-t-sm ${
                    isDarkMode ? "bg-indigo-400" : "bg-indigo-400"
                  }`}
                ></div>
                <span
                  className={`text-xs mt-1 ${
                    isDarkMode ? "text-gray-400" : "text-gray-800"
                  }`}
                >
                  F
                </span>
              </div>
              <div className="flex flex-col items-center">
                <div
                  className={`w-4 h-6 rounded-t-sm ${
                    isDarkMode ? "bg-indigo-200" : "bg-indigo-200"
                  }`}
                ></div>
                <span
                  className={`text-xs mt-1 ${
                    isDarkMode ? "text-gray-400" : "text-gray-800"
                  }`}
                >
                  S
                </span>
              </div>
              <div className="flex flex-col items-center">
                <div
                  className={`w-4 h-4 rounded-t-sm ${
                    isDarkMode ? "bg-indigo-100" : "bg-indigo-100"
                  }`}
                ></div>
                <span
                  className={`text-xs mt-1 ${
                    isDarkMode ? "text-gray-400" : "text-gray-800"
                  }`}
                >
                  S
                </span>
              </div>
            </div>
          </div>
        </div>

        <div
          className={`mt-8 p-4 rounded-lg ${
            isDarkMode ? "bg-indigo-900" : "bg-indigo-50"
          } text-left`}
        >
          <h4
            className={`font-medium mb-2 ${
              isDarkMode ? "text-gray-200" : "text-gray-800"
            }`}
          >
